import React from "react";
import styled from "styled-components";

const Wrapper = styled.footer`
  width: 100%;
  height: 277px;
  background-color: #f7f8fa;
`;
function Footer() {
  return (
    <Wrapper>
      <div className="container"></div>
    </Wrapper>
  );
}

export default Footer;
